function Home() {
  return <div>home</div>;
}
function About() {
  return <div>about</div>;
}
const routes = [
  {path: '/home', component: Home},
  {path: '/about', component: About},
]
function App() {
  return (
    <Router>
      <div className="App">
        <Header />
        <Navbar navItems={getNavItems()} />
        <Switch>
          {routes.map(route => {

          })}
          <Route path="/home" component={Home} />
          <Route path="/about" component={About} />
          <Route path="*" component={Main} />
        </Switch>
        <Footer />
      </div>
    </Router>
  );
}

export default App;
